import React, { Component } from "react";
import { Col, Panel } from 'react-bootstrap';
import HeaderBar from './../master/HeaderBar';
import './TextAnimation.css';
import './HomePage.css';
import Book from './../img/BookIcon.svg';
import Gear from './../img/GearIcon.svg';
import Shovel from './../img/ShovelIcon.svg';
import Runner from './../img/RunnerIcon.svg';
import Airplane from './../img/AirplaneIcon.svg';
import HoodieSelfie from './../img/HoodieSelfieNoLogo.jpg'

class HomePage extends Component {
    render() {
        return (
            <div>
                <HeaderBar title="JM Miller Consulting" />
                <Panel className="page-contents-panel" style={{ float:"left", width: "66%", margin: "0 16%" }}>
                    <hr style={{ background: "lightblue" }} />
                    <h4>Jonathan M Miller</h4>
                    <h5>...Who?</h5>
                    <br />
                    <div className="text-section" style={{float:"left"}}>
                    <div className="image-container " style={{float:"left", width:"45%", margin: "2%" }}>
                        <span className="image-label" >Working hard until 5AM @ CES 2019</span>
                        <img className="" style={{ width:"45%"}} src={HoodieSelfie}></img>
                    </div>
                        <div className="description-verb-list" style={{ width: "45%"}}>
                            <br />
                            <span style={{ marginTop: "3%", width: "100%" }} className="write-software"><span style={{ textAlign: "left", width: "100%" }}>I write software</span>&nbsp;&nbsp;<span className="UnderscoreIcon">&nbsp;</span></span>
                            <br />
                            <span style={{ marginTop: "3%", width: "100%" }} className="build-things"><span>I build hardware</span>&nbsp;&nbsp;<img className="GearIcon" style={{ width: "16px" }} src={Gear} /><img className="LittleGearIcon" style={{ width: "10px" }} src={Gear} /></span>
                            <br />
                            <span style={{ marginTop: "3%", width: "100%" }} className="volunteer"><span>I help out</span>&nbsp;&nbsp;<img className="ShovelIcon" style={{ width: "16px" }} src={Shovel} /><span></span></span>
                            <br />
                            <span style={{ marginTop: "3%", width: "100%" }} className="run-trails"><span>I run races</span>&nbsp;&nbsp;<span><img className="RunnerIcon" style={{ width: "16px" }} src={Runner} /></span></span>
                            <br />
                            <span style={{ marginTop: "3%", width: "100%" }} className="go-places"><span>I go places</span>&nbsp;&nbsp;<span><img className="AirplaneIcon" style={{ width: "16px" }} src={Airplane} /></span></span>
                            <br />
                            <span style={{ marginTop: "3%", marginBottom: "5%", textAlign: "left", width: "100%" }} className="tell-stories"><span>I tell stories</span>&nbsp;&nbsp;<span><img className="BookIcon" style={{ width: "16px" }} src={Book} /></span></span>
                            <br />
                        </div>
                        <div className="text-blurb">
                            <p>
                                If you're reading this site there's a pretty good chance that you either know me or you want to know me. Or maybe you're just a curious reader at the end of a long trail of purple hyperlinks.
                        </p>
                            <p>
                                In any case, I'm glad you're here. I hope you'll stay a while and take a look at the work I've done, the places I've been, and the stories I've told.
                        </p>
                        </div>
                    </div>
                </Panel>
            </div>
        )
    }

}

export default HomePage;
